import React from 'react';

function User({ user }){

    return (
        <div>
            <b>{user.username}  <span>({user.email})</span></b>
        </div>
    )
}

function UserList(){
    const users = [
      {
        id: 1,
        username: "j0dev",
        email: "asdf@asdf.com"
      },
      {
        id: 2,
        username: "intadd",
        email: "qwer@asdf.com"
      },
      {
        id: 3,
        username: "test",
        email: "zxcv@asdf.com"
      }
    ];
    return (
        <div>
            {
                users.map(
                    user => (<User user={user} key={user.id}/>)
                )
            }
            <button></button>
        </div>
    ) 
}



export default UserList;
